import React from "react";
import 'index.css'

function FooterButtons({label1, label2, callback1, callback2, visible1=true,visible2=true}){
   return (
       <div>
            {visible1 && <Button className='Button' type='primary' onClick={callback1}>{label1}</Button>}
            {visible2 && <Button className='Button' type='primary' onClick={callback2}>{label2}</Button>}
       </div>
   );
}

export default FooterButtons;
